import React, { useRef } from 'react';
import './App.css';
import idCardImage from './images/Vishnu_ID_Card.png'; // Importing image
import selfieImage from './images/selfie-without-specs.jpg'; // Importing image

function App() {
  const idCardRef = useRef();
  const selfieRef = useRef();

  return (
    <>
      <div className="gallery">
        <img ref={idCardRef} src={idCardImage} alt="ID card" style={{ height: 'auto' }} />
      </div>

      <div className="gallery">
        <img ref={selfieRef} src={selfieImage} alt="Selfie" style={{ height: 'auto' }} />
      </div>
    </>
  );
}

export default App;
